$(document).ready(function() {

	 for(var id in states){
	 	var statedrp = document.getElementById("state-enter");
	 	var optn = document.createElement("option"); 
	 	optn.text=states[id];  
		optn.value=id; 
		statedrp.add(optn);
	 }

	 $("#state-enter").change( function() {

	 	$(".mun-div").show();
	 	var e = document.getElementById("state-enter");
		var state = e.options[e.selectedIndex].value;
	 	$("#mun-enter").empty();

	 		 	var statedrp = document.getElementById("mun-enter");
	 		var optn = document.createElement("option"); 
	 		optn.text= "Please Enter Your Municipality" ;  
			optn.value= "-1"; 
			statedrp.add(optn);

	 	var ms = municipalities[state+""]
	 	for(var m in ms){
	 		var statedrp = document.getElementById("mun-enter");
	 		var optn = document.createElement("option"); 
	 		optn.text=ms[m][1];  
			optn.value=ms[m][0]; 
			statedrp.add(optn);
	 	}
	 })

	 $("#mun-enter").change( function() {

	 	$(".nei-div").show();
	 	var e = document.getElementById("state-enter");
		var state = e.options[e.selectedIndex].value;

		var e1 = document.getElementById("mun-enter");
		var mun = e1.options[e1.selectedIndex].value;

	 	$("#nei-enter").empty();

	 	var statedrp = document.getElementById("nei-enter");
	 		var optn = document.createElement("option"); 
	 		optn.text= "Please Enter Your Neighborhood" ;  
			optn.value= "-1"; 
			statedrp.add(optn);

	 	var ms = neighborhoods[state + " " + mun]
	 	for(var m in ms){
	 		var statedrp = document.getElementById("nei-enter");
	 		var optn = document.createElement("option"); 
	 		optn.text=ms[m][1];  
			optn.value=ms[m][0]; 
			statedrp.add(optn);
	 	}
	 })
});